import React from 'react';
import { FaBars } from 'react-icons/fa';
import { useGlobalContext } from './context';
import { useRef } from 'react';
import { useEffect } from 'react';

const Home = () => {

  let CounterRef = useRef(0)

  useEffect(()=>{
    CounterRef.current += 1;

  })

  let Click=()=>{
    console.log(CounterRef.current);                          

  }



  const { openSidebar, openModal } = useGlobalContext();
  return (
    <main>
      <button onClick={openSidebar} className='sidebar-toggle'>
        <FaBars />
      </button>
      <button onClick={openModal} className='btn'>
        show modal
      </button>
      <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3871.157702509609!2d74.33909841434088!3d31.49490334473625!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x391905f4fd0bddbf%3A0x7b0bf192679c16d4!2sFootball%20Ground%20Askari%20V!5e1!3m2!1sen!2s!4v1687518361202!5m2!1sen!2s" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>
      <button onClick={Click} className='btn'>
        Click Me
      </button>
    </main>
  );
};

export default Home;
